With(
    {param: Param("subEntityId")},
    If(
        IsBlank(param),
        Blank(),
        With(
            {pathItems: Split(param,"/")},
            With(
                {path: ForAll(
                    pathItems,
                    With(
                        {
                            itemValues: Split(
                                Value,
                                ":"
                            )
                        },
                        If(
                            CountRows(itemValues) <> 2,
                            Blank(),
                            {
                                EntityType: Index(
                                    itemValues,
                                    1
                                ).Value,
                                EntityId: Index(
                                    itemValues,
                                    2
                                ).Value
                            }
                        )
                    )
                )},
                If(
                    IsEmpty(path),
                    Blank(),
                    path
                )
            )
        )
    )
)

